<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Kwitansi Pembayaran SPP {{ $pembayaran->kd_transaksi }}</title>
    <style>
        .receipt-table {
            width: 100%;
            border-collapse: collapse;
        }

        .receipt-table,
        .receipt-table th,
        .receipt-table td {
            border: 1px solid black;
        }

        .left-section {
            text-align: center;
            vertical-align: top;
            padding: 10px;
            width: 33.33%;
        }

        .left-section img {
            width: 100px;
            margin-top: 4.3rem;
        }

        .left-section h2 {
            margin-top: 10px;
        }

        .right-section {
            padding: 10px;
            width: 66.67%;
            text-align: center;
        }

        .details-section ul {
            list-style: none;
            padding-left: 0;
            text-align: left;
            display: inline-block;
        }

        .details-section li {
            margin-bottom: 5px;
        }

        .title-center {
            text-align: center;
            font-weight: bold;
            font-size: 24px;
            margin: 0;
        }
    </style>
</head>

<body>
    <table class="receipt-table">
        <tr>
            <td class="left-section" rowspan="2">
                <img src="data:image/png;base64," alt="Logo">
                <h3>KWITANSI PEMBAYARAN SPP <br> SMK DIPONEGORO</h3>
            </td>
            <td class="title-center" colspan="2">KWITANSI PEMBAYARAN SPP</td>
        </tr>
        <tr>
            <td class="right-section" colspan="2">
                <div class="details-section">
                    <ul>
                        <li><b>Kode Transaksi:</b> {{ $pembayaran->kd_transaksi }}</li>
                        <li><b>Telah Diterima Dari:</b> {{ $pembayaran->siswa->nama }}</li>
                        <li><b>Untuk Pembayaran:</b> SPP</li>
                        <li><b>Tanggal:</b> @date_indo_formatted($pembayaran->tgl_bayar)</li>
                        <li><b>Rupiah:</b> @currency($pembayaran->jumlah_bayar)</li>
                        <li><b>Uang Sejumlah:</b> @currency_to_text($pembayaran->jumlah_bayar) rupiah</li>
                    </ul>
                </div>
            </td>
        </tr>
    </table>
</body>

</html>
